import React from "react";
import "./App.css";
import Header from "./component/Header";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Home from "./component/Home";
import Footer from "./component/Footer";
import Register from "./component/Register";
import logo_two from "./component/icon/logo_two.png";
import logo_sm_three from "./component/icon/logo_sm_three.png";
import Login from "./component/Login";
import Checkout from "./component/Checkout";
import Payment from "./component/Payment";
import Search from "./component/Search";
import AdminPanel from "./component/Admin/AdminPanel";
import Dashboard from "./component/Admin/Dashboard";
import Product from "./component/Admin/ProductUpdate";

function App() {
  return (
    <Router>
      <div className="app">
        <Switch>
        <Route path="/details">
            <Deta />
          </Route>
        details
        <Route path="/product">
            <Product />
          </Route>
          <Route path="/dashboard">
            <Dashboard />
          </Route>
          <Route path="/admin">
            <AdminPanel />
          </Route>
          <Route path="/search">
            <Header />
            <Search />
            <Footer />
          </Route>
          <Route path="/payment">
            <Header />
            <Payment />
            <Footer />
          </Route>
          <Route path="/register">
            <Register icon={logo_two} />
          </Route>
          <Route path="/cart">
            <Header />
            <Checkout />
            <Footer />
          </Route>
          <Route path="/login">
            <Login icon={logo_sm_three} />
          </Route>

          <Route path="/">
            <Header />
            <Home />
            <Footer />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
